ão podemos esperar que o problema aconteça, abrir um chamado e aguardar a análise enquanto nossas lojas perdem vendas em um dos períodos mais críticos do ano, o final de ano. Precisamos de uma solução imediata e eficaz.'),(5,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Em uma escala de 0 a 10, quanto você recomendaria nossa empresa para amigos ou familiares?','10',''),(6,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Como você avalia a qualidade do atendimento prestado neste chamado?','Ótimo',''),(7,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','A nossa empresa facilitou a solução do seu Problema ou Requisição?','Concordo Totalmente',''),(8,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Deixa uma Mensagem para a nossa Gestão :)','',''),(9,'1224-000382','Portal - Comnect - Outros','2024-12-20','2024-12-20','TOTVS SA','Thiago Martimiano','Paulo Souza','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Em uma escala de 0 a 10, quanto você recomendaria nossa empresa para amigos ou familiares?','10',''),(10,'1224-000382','Portal - Comnect - Outros','2024-12-20','2024-12-20','TOTVS SA','Thiago Martimiano','Paulo Souza','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Como você avalia a qualidade do atendimento prestado neste chamado?','Ótimo',''),(11,'1224-000382','Portal - Comnect - Outros','2024-12-20','2024-12-20','TOTVS SA','Thiago Martimiano','Paulo Souza','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','A nossa empr